import { Grid } from "@mui/material";
import React from "react";

const Header = () => {
  return (
    <div>
      <Grid container>
        <Grid xs={12} sm={6} md={8}></Grid>
        <Grid
          xs={12}
          sm={6}
          md={4}
          sx={{
            backgroundColor: "#00B0EF",
          }}
        ></Grid>
      </Grid>
    </div>
  );
};

export default Header;
